              nextIndex += 1
            }

            minW = isDown ? nextQuery?.minW : minW
            maxW = isDown ? maxW : nextQuery?.maxW

            query = createQuery(minW, maxW)
          }

          const queryStyles = getStyles<IsMulti>(
            modifierStyles[modifier],
            props,
          )({ isMulti, query })

          prev = merge(prev, queryStyles)

          return prev
        },
        {},
      )
