const getModifierStyles =
  <IsMulti extends boolean = false>(
    value: ResponsiveObject<string> | ColorModeArray<string> | string,
    modifierStyles: ModifierStyles,
    props: UIStyleProps,
  ) =>
  ({ isMulti }: GetStylesOptions): Styles<IsMulti> => {
